import React from "react";

export const AskPage = () => {



    return (
        <div className="ask">
            <h1>Ask the question</h1>

            <form action="" className="ask-form">
                <div className="ask-form__input">

                    <textarea type="text" id="ask-title"/>
                </div>

                <button className="btn">Submit</button>
            </form>
        </div>
    )
}
